function HelloMessage(props) {
    const { query, textNodesList } = props;

    return (
        <>
            {textNodesList.map(textNodeDtrObject => {
                return (
                    <p style={{ padding: '10px', textAlign: 'center' }}>
                        <GetDynamicString
                            textNodeDtrObject={textNodeDtrObject}
                            query={query}
                        />
                        {/* <GetDynamicElement /> */}
                    </p>
                );
            })}
        </>
    );
}

module.exports = HelloMessage;
